import data from "./Data2";
import "./Content.css";
import { Link } from "react-router-dom";
function Item(props) {
  let one;
  let two;
  let three;
  let four;
  let length;
  if (props.notindex === -1) {
    length = data.properties.length;
    if (data.properties.length % 4 === 0) {
      one = props.one;
      two = props.two;
      three = props.three;
      four = props.four;
    } else if (data.properties.length % 4 === 1) {
      one = props.one;
    } else if (data.properties.length % 4 === 2) {
      one = props.one;
      two = props.two;
    } else if (data.properties.length % 4 === 0) {
      one = props.one;
      two = props.two;
      three = props.three;
    }
  } else {
  }
  if (props.sign === 1) {
    return (
      <div className="wrapper1">
        <div className="wrapper2">
          <div className="wrapper20">
            <Link
              to={{ pathname: "/bestItem", state: one }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[one].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[one].name}</p>
                <p className="txt">{data.properties[one].price}</p>
              </div>
            </Link>
            <Link
              to={{ pathname: "/bestItem", state: two }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[two].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[two].name}</p>
                <p className="txt">{data.properties[two].price}</p>
              </div>
            </Link>
          </div>
          <div className="wrapper20">
            <Link
              to={{ pathname: "/bestItem", state: three }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[three].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[three].name}</p>
                <p className="txt">{data.properties[three].price}</p>
              </div>
            </Link>
            <Link
              to={{ pathname: "/bestItem", state: four }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[four].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[four].name}</p>
                <p className="txt">{data.properties[four].price}</p>
              </div>
            </Link>
          </div>
        </div>
      </div>
    );
  } else if (data.properties.length % 4 === 1) {
    return (
      <div className="wrapper1">
        <div className="wrapper2">
          <div className="wrapper20">
            <Link
              to={{ pathname: "/bestItem", state: { one } }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[one].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[one].name}</p>
